import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Menu.css';

const Menu = ({ loggedIn, handleLogout }) => {
  const navigate = useNavigate();

  const handleLogoutClick = () => {
    handleLogout();
    navigate('/login');
  };

  return (
    loggedIn && (
      <div className="menu">
        <ul className="menu-links">
          <li className="menu-link"><Link to="/">Strona główna</Link></li>
          <li className="menu-link"><Link to="/calendar">Zarezerwuj wizytę</Link></li>
          <li className="menu-link"><Link to="/profile">Profil</Link></li>
          <li><button className="menu-button" onClick={handleLogoutClick}>Wyloguj</button></li>
        </ul>
      </div>
    )
  );
};

export default Menu;
